    "Highly Efficient, Compact, Wavelength Converters for Pulsed and CW Laser Sources
    Used in Lidar-Based Remote Sensing and Ranging Systems Project",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:10:56.210322",nt"name": "highly-efficient-compact-wavelength-converters-for-pulsed-and-cw-laser-sources-used-in-lid",nt"isopen":
    true,nt"url": null,nt"notes": "AdvR, Inc. proposes the development of a
    highly efficient, fiber pigtailed, waveguide-based UV frequency converter module.
     This UV module will be an important element in future NASA sponsored Doppler lidar
    and High Spectral Resolution Lidar (HSRL) aerosol missions.  The key innovation
    is the use of dual-element periodically poled waveguides embedded in a nonlinear
    optical substrate.  This innovation results in a vast improvement in the measurement
    capabilities of lidar systems by enabling the use of a single stabilized laser to
    both operate a high power transmitter and generate low power frequency tripled light
    for synchronous calibration and frequency locking of the Fabry Perot filter on the
    lidar receiver.  To be used in a space-based system, the UV module must be rugged
    and must perform optimally in a radiation environment over the mission lifetime.
     To achieve this goal, the proposed dual-element structure will be packaged in
    a compact, robust fiber-pigtailed package which will readily lend itself to future
    space qualification for mechanical stability of the package and radiation damage
    resistance of the non-linear optical material.",nt"license_title": "U.S. Government
